import { Button, Box } from '@material-ui/core';

import { LOADINGCOLOR } from '../color/loading.js';

const Loading = ({
    
}) => {
  return(
    <Box
      display='flex'
      justifyContent='center'
      bgcolor={LOADINGCOLOR}
      height='inherit'
    >
      <Button color="primary"> Hello world </Button>
    </Box>
    )
}

export default Loading;
